import React from 'react';
import BlogCard from './BlogCard';
import blogData from '../blogData';
import 'tachyons';

const BlogCardGrid = () => {
  const blogDataArray = blogData.map((post) => {
    return(
      <div className="container">
        <BlogCard key={post.id} intro={post.intro} content={post.content} title={post.title} />
      </div>
    );  
  });
  return(
    <div>
      {blogDataArray}
    </div>
  );
}

export default BlogCardGrid;
